value.history:
={{
$('Current State').item.json.status !== $('Previous State').item.json.status
  ? `{$now.toISO()} [status] ` + (
    $('Current State').item.json.status === 'active'
    ? 'Workflow was activated'
    : 'Workflow was deactivated'
  )
  : ''
}}
{{$now.toISO() }} [connections] {{ $json.connections.added_total }} added, {{ $json.connections.removed_total }} removed
{{$now.toISO() }} [nodes] {{ $json.nodes.added_total }} added, {{ $json.nodes.removed_total }} removed
