assignments.value:
={{
(function(connections){
  return connections
    .keys()
    .flatMap(key =>
      connections[key].keys().map(subkey =>
        connections[key][subkey].flatMap(node =>
          node.map(item =>
            ({ key, node: item.node, index: item.index })
          )
        )
      )
    )
})($json.connections)
}}
